import React from "react";
import AppBar from "@mui/material/AppBar";
import { GlobalStyles, Toolbar, Typography, colors } from "@mui/material";

const Header = () => {
  return (
    <AppBar sx={colors}>
      <GlobalStyles styles={{body: {backgroundColor: "darkblue"}}}/>
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1}}>
          Valantis
        </Typography>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
